/* Table structure for Incidencias */
CREATE TABLE `Incidencias` (
  `incidencia_id` int(8) NOT NULL AUTO_INCREMENT,
  `titulo` varchar(64) NOT NULL,
  `lugar` varchar(64) NOT NULL,
  `descripcion` varchar(1024) NOT NULL,
  `palabrasClave` varchar(128) NOT NULL,
  `photo` blob,
  `fechaInclusion` datetime DEFAULT NULL,
  `email` varchar(32) NOT NULL,
  `estado` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`incidencia_id`),
  KEY `incidencia_id` (`incidencia_id`),
  KEY `email` (`email`),
  CONSTRAINT `Incidencias_ibfk_1` FOREIGN KEY (`email`) REFERENCES `Usuarios` (`email`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

